import React from "react";
import "./style.css";

const Jumbotron = () => (
	<header className = "header">
		<h1>Marvel Clicky Game!</h1>
		<h2>Click on any pictures below, but do not click more than once!</h2>
		<h3 className="message">{this.props.message} </h3>
	</header>
);


export default Jumbotron;
